import React from 'react';
import './App.css';

const Header = React.lazy(() => import('component/Header'))
function App() {
  return (
    <div className="App">
      <Header/>
      <main className="App-body">

      </main>
      <footer className="App-footer">
        <p style={{ fontSize: 8 }}>
          {`${process.env.REACT_APP_WEBSITE_NAME} V${process.env.REACT_APP_VERSION}`}
        </p>
      </footer>
    </div>
  );
}

export default App;
